    main_category TEXT,
    no_nutrition_data BOOLEAN,
    nova_group INTEGER,
    nutriscore_grade CHAR(1),
    nutriscore_score INTEGER,
    owner TEXT,
    pnns_groups_1 TEXT,
    pnns_groups_2 TEXT,
    product_name TEXT,
    product_quantity INTEGER,
    quantity TEXT,
    serving_quantity NUMERIC,
    serving_size TEXT,
    unique_scans_n INTEGER,
    url TEXT,
    alcohol_100g NUMERIC(30,20),
    added_sugars_100g NUMERIC(30,20),
    alpha_linolenic_acid_100g NUMERIC(30,20),
    arachidic_acid_100g NUMERIC(30,20),
