    energy_from_fat_100g NUMERIC(30,20),
    energy_kcal_100g NUMERIC(30,20),
    energy_kj_100g NUMERIC(30,20),
    energy_100g NUMERIC(30,20),
    fat_100g NUMERIC(30,20),
    fiber_100g NUMERIC(30,20),
    folates_100g NUMERIC(30,20),
    fruits_vegetables_nuts_estimate_from_ingredients_100g NUMERIC(30,20),
    fruits_vegetables_nuts_estimate_100g NUMERIC(30,20),
    fruits_vegetables_nuts_100g NUMERIC(30,20),
    gamma_linolenic_acid_100g NUMERIC(30,20),
    insoluble_fiber_100g NUMERIC(30,20),
    iodine_100g NUMERIC(30,20),
    iron_100g NUMERIC(30,20),
    lactose_100g NUMERIC(30,20),
    magnesium_100g NUMERIC(30,20),
    manganese_100g NUMERIC(30,20),
    molybdenum_100g NUMERIC(30,20),
    monounsaturated_fat_100g NUMERIC(30,20),
    nucleotides_100g NUMERIC(30,20),
    nutrition_score_fr_100g NUMERIC(30,20),
    omega_3_fat_100g NUMERIC(30,20),
    omega_6_fat_100g NUMERIC(30,20),
    omega_9_fat_100g NUMERIC(30,20),
    pantothenic_acid_100g NUMERIC(30,20),
    ph_100g NUMERIC(30,20),
    phosphorus_100g NUMERIC(30,20),
    phylloquinone_100g NUMERIC(30,20),
    polyols_100g NUMERIC(30,20),
    polyunsaturated_fat_100g NUMERIC(30,20),
    potassium_100g NUMERIC(30,20),
    proteins_100g NUMERIC(30,20),
    salt_100g NUMERIC(30,20),
    saturated_fat_100g NUMERIC(30,20),
    selenium_100g NUMERIC(30,20),
    sodium_100g NUMERIC(30,20),
    soluble_fiber_100g NUMERIC(30,20),
